    "full_model <- lm(total_transaction_revenue ~ . - category, data = train)\n",
    "small_model <- stepAIC(full_model, direction = c(\"backward\"), trace = FALSE)\n",
    "small_model_predictions <- predict(small_model, test)"
   ]
